import React from 'react'
import ReactDOM from 'react-dom'

const Header = () =>{
  const heading = "Half Stack Application developement"
  return(
  <div>
    <h1>{heading}</h1>
  </div>
  )
}

const Content = () =>{
  const part1 = {
    name : "Fundamentals of react",
    exercise : 10
  }
  const part2 = {
    name : "Using props to pass data",
    exercise : 7
  }
  const part3 = {
    name : "State of a component",
    exercise : 14
  }
  return(
    <div>
      <p>{part1.name} {part1.exercise}</p>
      <p>{part2.name} {part2.exercise}</p>
      <p>{part3.name} {part3.exercise}</p>
    </div>
  )
}

const Total = () =>{
  const total = 31
  return(
    <div>
      <p>Number of exercises {total}</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <Header />
      <Content />
      <Total />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
